import React, { Component } from 'react'
import './card.css'
import Flag from '../Flag/Flag'
import Location from '../Location/Location'
import Time from '../Time/Time'
import Weather from '../Weather'

export class Card extends Component {
    render() {
        return (
            <div>
                <Flag />
                <Location />
                <Time />
                <Weather />
            </div>
        )
    }
}

export default Card
